// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;

import "../know-token/KnowlageToken.sol";
import "../know-proxy/TokenProxy.sol";
import "../know-proxy/BlackListProxy.sol";
import "../know-proxy/TransferProxy.sol";
import "../know-proxy/ReceiveFeeProxy.sol";
import "../know-template/TicketERC20Template.sol";
import "../know-interface/IReceiver.sol";
import "../know-interface/IBlackList.sol";

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/proxy/Clones.sol";

/**
 * @title Major Factory Contract
 * @notice HorseRace is a NFT horse racing metaverse based on pylogon
 * @notice ....
 *
 * @notice Website: https://horse-racing.io/
 * @notice Docs: https://horse-racing.gitbook.io/horse-racing-docs/
 * 
 * @dev Version: v1.0.1
 */
contract SubjectTemplate is Initializable, AccessControl, Pausable {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.Bytes32Set;
    using EnumerableSet for EnumerableSet.AddressSet;

    struct Subject {
        /** @notice  */
        address tuitionToken;
        address ticketToken;
        address creater;
        uint256 totalShares;
        uint256 joinShares;
        uint256 uintTuitionAmount;
        uint256 endTime;
        uint256 freeTime;
        uint256 status;
        string descriptionURI;
        EnumerableSet.AddressSet members;
        EnumerableSet.AddressSet teachers;
        mapping (address => uint256) shares;
        mapping (address => uint256) tickets;
    }

    struct Courseware {
        string descriptionURI;
        bytes32[] freeCoursewareURIs;
        bytes32[] otherCoursewareURIs;
        uint256 reports;
        uint256 status;
        bool isFreeWhenEnd;
    }

    /** @notice Version of contract */
    string constant public LASTEST_VERSION = "v1.0.1";

    /** @notice The role of access control - (admin role) */
    bytes32 constant public ADMIN_ROLE = keccak256("ADMIN_ROLE");

    /** @notice Address of token proxy contract - For subject mint token */
    TokenProxy public tokenProxy;

    /** @notice Address of transfer proxy contract - For subject transfer token */
    TransferProxy public transferProxy;

    /** @notice Address of black list proxy contract - For subject black list */
    BalckListProxy public blackListProxy;

    /** @notice Address of fee receiver proxy contract - For subject transfer fee */
    ReceiveFeeProxy public receiveFeeProxy;

    /** @notice Address of ticket lp token contract - For subject transfer ticket token */
    address public ticketERC20Template;

    string public subjectURI;

    EnumerableSet.Bytes32Set private _subjectIds;

    mapping (bytes32 => Subject) private _subjects;

    mapping (address => EnumerableSet.Bytes32Set) private _applys;
    mapping (address => EnumerableSet.Bytes32Set) private _joineds;

    mapping (address => EnumerableSet.Bytes32Set) private _teaching;
    mapping (bytes32 => mapping (address => Courseware)) private _coursewares;

    event AskNewSubject(bytes32 subjectId, address tuitionToken, address ticketToken);
    event JoinSubject(address ticketToken, uint256 members, uint256 teachers);
    event ExitSubject(address ticketToken, uint256 amount, uint256 members);
    event UploadCourseware(uint256 members, uint256 coursewareURIs);
    event VoteTo(uint256 leftTickets, uint256 knowAmount);
    event SwapReward(uint256 amount, uint256 fee, address tuitionToken);

    function _transfer(
        address tuitionToken, address from, address to, uint256 amount
    ) private returns (bool) {
        if (tuitionToken == address(0)) {
            // require(msg.value >= amount, "INVALID_AMOUNT");
            payable(from).transfer(amount);
            return true;
        } else {
            return transferProxy.transferFrom(tuitionToken, from, to, amount);
        }
    }

    function _mintKnowToken(address account, uint256 amount) private {
        address token = tokenProxy.getImplementation();
        KnowlageToken(token).mintTo(account, amount);
    }

    modifier isBlackList() {
        address blackList = blackListProxy.getImplementation();
        require(!IBlackList(blackList).isBlackList(_msgSender()), "BLACK_LIST");
        require(!paused(), "PAUSED");

        _;
    }

    function initialize(
        address admin, address[5] memory proxys, string memory _subjectURI
    ) public initializer {
        _grantRole(ADMIN_ROLE, admin);

        subjectURI = _subjectURI;

        tokenProxy = TokenProxy(payable(proxys[0]));
        transferProxy = TransferProxy(proxys[1]);
        blackListProxy = BalckListProxy(payable(proxys[2]));
    }

    function getSubjectDetail(bytes32 subjectId) public view returns (
        string memory uri, address[3] memory addrs, uint256[6] memory settings,
        address[] memory members, address[] memory teachers
    ) {
        uri = _subjects[subjectId].descriptionURI;

        addrs[0] = _subjects[subjectId].tuitionToken;
        addrs[1] = _subjects[subjectId].ticketToken;
        addrs[2] = _subjects[subjectId].creater;

        settings[0] = _subjects[subjectId].totalShares;
        settings[1] = _subjects[subjectId].joinShares;
        settings[2] = _subjects[subjectId].uintTuitionAmount;
        settings[3] = _subjects[subjectId].endTime;
        settings[4] = _subjects[subjectId].freeTime;
        settings[5] = _subjects[subjectId].status;

        uint256 length = _subjects[subjectId].members.length();
        members = new address[](length);

        for (uint256 index = 0; index < length; index++) {
            members[index] = _subjects[subjectId].members.at(index);
        }

        length = _subjects[subjectId].teachers.length();
        teachers = new address[](length);

        for (uint256 index = 0; index < length; index++) {
            teachers[index] = _subjects[subjectId].teachers.at(index);
        }
    }

    function getSubjectCourseware(
        bytes32 subjectId, address teacher
    ) public view returns (string memory uri, bytes32[] memory free, bytes32[] memory other) {
        uri = _coursewares[subjectId][teacher].descriptionURI;
        free = _coursewares[subjectId][teacher].freeCoursewareURIs;

        if (_subjects[subjectId].endTime > block.timestamp) {
            if (_coursewares[subjectId][teacher].isFreeWhenEnd)
                other =  _coursewares[subjectId][teacher].otherCoursewareURIs;
        } else {
            if (_subjects[subjectId].members.contains(_msgSender()))
                other =  _coursewares[subjectId][teacher].otherCoursewareURIs;
        }
    }

    function togglePause(bool status) public onlyRole(ADMIN_ROLE) {
        if (status) _pause();
        else _unpause();
    }

    function askNewSubject(
        address tuitionToken, uint256[5] memory parms, string memory descriptionURI
    ) public payable isBlackList {
        require(parms[4] > 0, "INVALID_SHARES");

        bytes32 subjectId = keccak256(abi.encodePacked(tuitionToken, descriptionURI));

        _subjects[subjectId].tuitionToken = tuitionToken;
        _subjects[subjectId].creater = _msgSender();
        _subjects[subjectId].totalShares = parms[0];
        _subjects[subjectId].joinShares = parms[4];
        _subjects[subjectId].uintTuitionAmount = parms[1];
        _subjects[subjectId].endTime = parms[2];
        _subjects[subjectId].freeTime = parms[3];
        _subjects[subjectId].members.add(_msgSender());
        _subjects[subjectId].shares[_msgSender()] = parms[4];

        if (parms[1] > 0) {
            uint256 tuitionAmount = parms[4] > 0 ? parms[1].mul(parms[4]) : parms[1];
            require(_transfer(tuitionToken, _msgSender(), address(this), tuitionAmount), "TRANSFER_FAILD");

            _subjects[subjectId].ticketToken = Clones.clone(ticketERC20Template);
            TicketERC20Template ticket = TicketERC20Template(_subjects[subjectId].ticketToken);
            ticket.initialize(address(this), 100000000e18);
            ticket.transfer(_msgSender(), tuitionAmount.mul(10000));
            _subjects[subjectId].tickets[_msgSender()] = tuitionAmount;
        }

        _applys[_msgSender()].add(subjectId);
        _joineds[_msgSender()].add(subjectId);
        _subjectIds.add(subjectId);

        emit AskNewSubject(subjectId, tuitionToken, _subjects[subjectId].ticketToken);
    }

    function joinSubject(bytes32 subjectId, uint256 shares) public payable isBlackList {
        require(shares > 0, "INVALID_SHARES");
        require(_subjectIds.contains(subjectId), "NOT_EXISTS");

        Subject storage subject = _subjects[subjectId];
        require(subject.totalShares == 0 || subject.joinShares < subject.totalShares, "FULL");

        if (subject.uintTuitionAmount > 0) {
            uint256 uintAmount = subject.uintTuitionAmount;
            uint256 tuitionAmount = shares > 0 ? uintAmount.mul(shares) : uintAmount;

            require(_transfer(
                subject.tuitionToken, _msgSender(), address(this), tuitionAmount
            ), "TRANSFER_FAILD");

            if (subject.ticketToken != address(0)) {
                TicketERC20Template ticketToken = TicketERC20Template(subject.ticketToken);
                ticketToken.transfer(_msgSender(), tuitionAmount);
            }

            subject.joinShares = subject.joinShares.add(shares);
            uint256 ticket = _subjects[subjectId].tickets[_msgSender()].add(tuitionAmount);
            _subjects[subjectId].tickets[_msgSender()] = ticket;
        }

        subject.members.add(_msgSender());
        shares = shares.add(subject.shares[_msgSender()]);
        subject.shares[_msgSender()] = shares;
        _joineds[_msgSender()].add(subjectId);

        emit JoinSubject(subject.ticketToken, subject.members.length(), subject.teachers.length());
    }

    function exitSubject(bytes32 subjectId) public payable isBlackList {
        require(_subjectIds.contains(subjectId), "NOT_EXISTS");

        uint256 amount;
        Subject storage subject = _subjects[subjectId];
        require(subject.members.contains(_msgSender()), "NOT_JOIN");

        if (subject.uintTuitionAmount > 0) {
            amount = subject.shares[_msgSender()].mul(subject.uintTuitionAmount);

            require(_transfer(
                subject.ticketToken, _msgSender(), address(this), amount.mul(10000)
            ), "INVALID_TICKET");

            require(_transfer(subject.tuitionToken, address(this), _msgSender(), amount));
        }

        subject.members.remove(_msgSender());
        _joineds[_msgSender()].remove(subjectId);

        subject.joinShares = subject.joinShares.sub(subject.shares[_msgSender()]);
        delete subject.shares[_msgSender()];

        emit ExitSubject(subject.ticketToken, amount, subject.members.length());
    }

    function uploadCourseware(
        bytes32 subjectId, string memory descriptionURI, bytes32[] memory freeCoursewareURIs,
        bytes32[] memory otherCoursewareURIs, bool isFreeWhenEnd
    ) public isBlackList {
        require(_subjectIds.contains(subjectId), "NOT_EXISTS");

        if (_teaching[_msgSender()].contains(subjectId)) {
            delete _coursewares[subjectId][_msgSender()].freeCoursewareURIs;
            delete _coursewares[subjectId][_msgSender()].otherCoursewareURIs;
        } else {
            _teaching[_msgSender()].add(subjectId);
            _subjects[subjectId].teachers.add(_msgSender());
            _coursewares[subjectId][_msgSender()].descriptionURI = descriptionURI;
        }

        _coursewares[subjectId][_msgSender()].isFreeWhenEnd = isFreeWhenEnd;
        _coursewares[subjectId][_msgSender()].freeCoursewareURIs = freeCoursewareURIs;
        _coursewares[subjectId][_msgSender()].otherCoursewareURIs = otherCoursewareURIs;

        uint256 coursewareURIs = freeCoursewareURIs.length + otherCoursewareURIs.length;

        emit UploadCourseware(_subjects[subjectId].members.length(), coursewareURIs);
    }

    function voteTo(bytes32 subjectId, address teacher, uint256 ticket) public isBlackList {
        require(_subjectIds.contains(subjectId), "NOT_EXISTS");

        Subject storage subject = _subjects[subjectId];
        require(subject.members.contains(_msgSender()), "NOT_JOIN");
        require(subject.tickets[_msgSender()] > 0, "TICKETS_OUT");

        uint256 amount = subject.tickets[_msgSender()];

        if (teacher == address(0) && ticket == 0) {
            uint256 teachers = subject.teachers.length();
            amount = amount.mul(10000).div(teachers);

            for (uint256 index = 0; index < teachers; index++) {
                teacher = subject.teachers.at(index);
                _transfer(subject.tuitionToken, _msgSender(), teacher, amount);
            }

            _mintKnowToken(_msgSender(), subject.tickets[_msgSender()]);
            subject.tickets[_msgSender()] = 0;

            emit VoteTo(0, amount.div(10000).mul(teachers));
        } else {
            require(subject.teachers.contains(teacher), "TEACHER_NOT_EXISTS");
            require(ticket > 0 && ticket <= amount, "INVALID_TICKETS");

            _transfer(subject.tuitionToken, _msgSender(), teacher, ticket.mul(10000));

            _mintKnowToken(_msgSender(), ticket);
            subject.tickets[_msgSender()] = subject.tickets[_msgSender()] - amount;

            emit VoteTo(subject.tickets[_msgSender()], ticket);
        }
    }

    function swapReward(bytes32 subjectId, uint256 amount) public isBlackList {
        require(_subjectIds.contains(subjectId), "NOT_EXISTS");

        Subject storage subject = _subjects[subjectId];
        require(subject.endTime > block.timestamp, "NOT_END");
        require(subject.teachers.contains(_msgSender()), "TEACHER_NOT_EXISTS");
        require(amount > 0, "INVALID_AMOUNT");

        require(_transfer(
            subject.ticketToken, _msgSender(), address(this), amount.mul(10000)
        ), "INVALID_TICKET");

        address receivePro = receiveFeeProxy.getImplementation();
        (address to, uint256 rate) = IReceiver(receivePro).getReceiver();
        uint256 fee = amount.mul(10000).div(rate);

        _transfer(subject.tuitionToken, address(this), _msgSender(), amount.sub(fee));
        _transfer(subject.tuitionToken, address(this), to, fee);
        _mintKnowToken(_msgSender(), amount);

        emit SwapReward(amount.sub(fee), fee, subject.tuitionToken);
    }
}

